import React from "react";
import "./styles.scss";
import { NavLink } from "react-router-dom";
import { routeContact as routeContactPage } from "../../pages/ContactPage";
import { routeMain as routeMainPage } from "../../pages/MainPage";
import { routeCategory as routeCategoryPage } from "../../pages/CategoryPage";
import { routeSearch as routeSearchPage } from "../../pages/SearchPage";
import newlogo from "../../pictures/newlogo.png";

const Header = () => {
  return (
    <header>
      <div className="navbar">
        <div className="container">
          <img className="imgR" src={newlogo} alt={"MOVIESinfo"} />

          <div className="navbar-link">
            <nav>
              <NavLink to={routeMainPage()} activeClassName={"linkActive"}>
                Главная
              </NavLink>
              <NavLink to={routeCategoryPage()} activeClassName={"linkActive"}>
                Фильмы по категориям
              </NavLink>
              <NavLink to={routeContactPage()} activeClassName={"linkActive"}>
                О нас
              </NavLink>
              <NavLink to={routeSearchPage()} activeClassName={"linkActive"}>
                Поиск
              </NavLink>
            </nav>
            <button className="change-view">{"adfghjgfdsaZSDFGHJKHGFDS"}</button>
          </div>
        </div>
      </div>
    </header>
  );
};
export default Header;
